import React, { Component } from 'react';
import Dialog from '@material-ui/core/Dialog';
import AppBar from '@material-ui/core/AppBar';
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

export class FormUserDetails extends Component {
  continue = e => {
    e.preventDefault();
    this.props.nextStep();
  };

  render() {
    const { values, handleFieldChange } = this.props;
    return (
      <MuiThemeProvider >
        <React.Fragment>
          <Dialog 
            open="true"
            fullWidth="true"
            maxWidth='sm'
          >
            <AppBar title={values.ProjectTitle} />
            <TextField
              placeholder="When did you start this project?"
              label="Start Date"
              onChange={handleFieldChange('dateStart')}
              defaultValue={values.Project.dateStart}
              margin="normal"
							fullWidth="true"
            />
            <br />
            <TextField
              placeholder="When is the Deadline Date?"
              label="Deadline"
              onChange={handleFieldChange('deadLine')}
              defaultValue={values.Project.deadLin}
              margin="normal"
							fullWidth="true"
            />
            <br />
            <TextField
              placeholder="Collaborators"
              label="How many people are working on this with you?"
              onChange={handleFieldChange('Collabz')}
              defaultValue={values.Project.Collabz}
              margin="normal"
							fullWidth="true"
            />
            <br />
            <Button
              color="primary"
              variant="contained"
              onClick={this.continue}
            >Continue</Button>
          </Dialog>
        </React.Fragment>
      </MuiThemeProvider>
    );
  }
}

export default FormUserDetails;
